import React, { useState } from 'react';
import axios from 'axios';

const CreateTicket = () => {
  const [formData, setFormData] = useState({
    actualPrice: '',
    comment: '',
    eventVenuesID: '',
    imageURL: '',
    listingPrice: '',
    lock: false,
    ordersID: '',
    sellerID: '',
    sellingPrice: '',
    status: '',
    type: '',
    validatedOn: '',
    verified: false,
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === 'checkbox' ? checked : value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5000/tickets', formData);
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="number" name="actualPrice" value={formData.actualPrice} onChange={handleChange} placeholder="Actual Price" />
      <input type="text" name="comment" value={formData.comment} onChange={handleChange} placeholder="Comment" />
      <input type="number" name="eventVenuesID" value={formData.eventVenuesID} onChange={handleChange} placeholder="Event Venue ID" />
      <input type="text" name="imageURL" value={formData.imageURL} onChange={handleChange} placeholder="Image URL" />
      <input type="number" name="listingPrice" value={formData.listingPrice} onChange={handleChange} placeholder="Listing Price" />
      <label>
        Lock:
        <input type="checkbox" name="lock" checked={formData.lock} onChange={handleChange} />
      </label>
      <input type="number" name="ordersID" value={formData.ordersID} onChange={handleChange} placeholder="Orders ID" />
      <input type="number" name="sellerID" value={formData.sellerID} onChange={handleChange} placeholder="Seller ID" />
      <input type="number" name="sellingPrice" value={formData.sellingPrice} onChange={handleChange} placeholder="Selling Price" />
      <input type="text" name="status" value={formData.status} onChange={handleChange} placeholder="Status" />
      <input type="text" name="type" value={formData.type} onChange={handleChange} placeholder="Type" />
      <input type="text" name="validatedOn" value={formData.validatedOn} onChange={handleChange} placeholder="Validated On" />
      <label>
        Verified:
        <input type="checkbox" name="verified" checked={formData.verified} onChange={handleChange} />
      </label>
      <button type="submit">Create Ticket</button>
    </form>
  );
};

export default CreateTicket;
